import { createContext, useContext, useState } from "react";

type YearContextType = {
    context: string | number,
    setContext: React.Dispatch<React.SetStateAction<string | number>>
}

const iYearContextState = {
   context: null,
   setContext: () => {}
}

export const YearContext = createContext<{ context: string | number, setContext: (newValue:string|number) => void }>({
    context: "",
    setContext: () => undefined})
